package com.heiya123.music.vo.kugou;import java.io.Serializable;public class KuGouMusicUrl implements Serializable{	private int bitRate;	private String extName;	private int fileHead;	private String fileName;	private int fileSize;	private int q;	private int status;	private int timeLength;	private String url;	public int getBitRate() {		return bitRate;	}	public void setBitRate(int bitRate) {		this.bitRate = bitRate;	}	public String getExtName() {		return extName;	}	public void setExtName(String extName) {		this.extName = extName;	}	public int getFileHead() {		return fileHead;	}	public void setFileHead(int fileHead) {		this.fileHead = fileHead;	}	public String getFileName() {		return fileName;	}	public void setFileName(String fileName) {		this.fileName = fileName;	}	public int getFileSize() {		return fileSize;	}	public void setFileSize(int fileSize) {		this.fileSize = fileSize;	}	public int getQ() {		return q;	}	public void setQ(int q) {		this.q = q;	}	public int getStatus() {		return status;	}	public void setStatus(int status) {		this.status = status;	}	public int getTimeLength() {		return timeLength;	}	public void setTimeLength(int timeLength) {		this.timeLength = timeLength;	}	public String getUrl() {		return url;	}	public void setUrl(String url) {		this.url = url;	}}